INSERT INTO `mxk_notices` VALUES ('06313064-6a73-47cf-94e8-76432bc6f52b','单点登录认证系统 MaxKey v 2.6.0GA发布','<p>单点登录认证系统 MaxKey v 2.6.0GA</p>','1',NULL,'2021-03-27 11:22:17',NULL,'2021-03-27 12:22:17','2.6.0GA'),('83cfea43-6e76-4c85-baa4-12182988bbde','单点登录认证系统 MaxKey v 2.4.0RC发布','<p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 单点登录认证系统 MaxKey v 2.4.0RC发布</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>MaxKey(马克思的钥匙)</strong>单点登录认证系统(Sigle Sign On System)，寓意是最大钥匙,是<strong>业界领先的企业级IAM身份管理和身份认证产品</strong>,支持OAuth 2.0/OpenID Connect、SAML 2.0、JWT、CAS、SCIM等标准协议，提供<strong>简单、标准、安全和开放</strong>的用户身份管理(IDM)、身份认证(AM)、单点登录(SSO)、RBAC权限管理和资源管理等。</p>','1',NULL,'2021-03-27 11:40:51',NULL,'2021-03-27 11:40:51','v 2.4.0RC');
